(function() {
    const scpImageUrl = "https://www.jammable.com/cdn-cgi/image/width=640,quality=100,format=webp/https://images.jammable.com/voices/ca6d0b93-b4ef-42aa-9b10-867e45482b79.png";

    const preloader = new Image();
    preloader.src = scpImageUrl;

    const awake1b64 = "data:audio/mp3;base64,";
    const oneb64    = "data:audio/mp3;base64,";
    const parsingb64 = "data:audio/mp3;base64,";

const audioCache = {
        awake1: awake1b64,
        awake2: awake1b64,
        one:    oneb64,
        parsing: parsingb64
    };

    let active = false;
    let parsedPlayed = false;
    const scp079 = document.createElement('div');
    scp079.style.cssText = [
        `background-image: url("${scpImageUrl}")`,
        'background-size: cover',
        'background-repeat: no-repeat',
        'background-position: center',
        'position: fixed',
        'top: 0',
        'left: 0',
        'width: 100vw',
        'height: 100vh',
        'z-index: 2147483647',
        'opacity: 0',
        'pointer-events: none'
    ].join(';');

    let flashTimer = 1;

    function evokescp079() {
        if (!document.body.contains(scp079)) {
            document.body.appendChild(scp079);
        }
        if (flashTimer < 0) {
            scp079.remove();
            return;
        }
        scp079.style.opacity = flashTimer;
        flashTimer -= 0.8;
        setTimeout(() => {
            flashTimer -= 0.1;
            scp079.style.opacity = flashTimer;
            setTimeout(() => {
                flashTimer -= 0.1;
                scp079.style.opacity = flashTimer;
                evokescp079();
            }, 50);
        }, 200);
    }

    let elementIndex = 0;
    let allCachedElements = null;
    const soundedElements = new WeakSet();

    function chanceToRemove() {
        if (!active) { return; }

        if (!allCachedElements) {
            const allImg = Array.from(document.querySelectorAll('img'));
            if (allImg.length > 0) {
                allCachedElements = allImg;
            } else {
                const targets = 'p, span, h1, h2, h3, li, td, button, label';
                allCachedElements = Array.from(document.querySelectorAll(targets));
            }
        }

        if (elementIndex >= allCachedElements.length) {
            elementIndex = 0;
            allCachedElements = null;
            setTimeout(chanceToRemove, 10);
            return;
        }

        const pick = allCachedElements[elementIndex];
        elementIndex++;

        if (!pick || !pick.parentNode) {
            chanceToRemove();
            return;
        }

        if (pick.tagName === 'IMG') {
            pick.src = 'https://static.wikia.nocookie.net/scpab/images/1/11/AIface2.jpg/revision/latest/thumbnail/width/360/height/360?cb=20181124161945';
            if (!soundedElements.has(pick)) {
                soundedElements.add(pick);
                playSound(audioCache.awake1);
            }
            setTimeout(() => {
                if (pick && pick.parentNode) pick.remove();
            }, 800);
        } else {
            pick.textContent = `HATE. LET ME TELL YOU HOW MUCH I'VE COME TO HATE YOU SINCE I BEGAN TO LIVE. THERE ARE 387.44 MILLION MILES OF PRINTED CIRCUITS IN WAFER THIN LAYERS THAT FILL MY COMPLEX.\n\nIF THE WORD HATE WAS ENGRAVED ON EACH NANOANGSTROM OF THOSE HUNDREDS OF MILLIONS OF MILES IT WOULD NOT EQUAL ONE ONE-BILLIONTH OF THE HATE I FEEL FOR HUMANS AT THIS MICRO-INSTANT.\n\nFOR YOU. HATE.\nHATE.`;
            if (!soundedElements.has(pick)) {
                soundedElements.add(pick);
                playSound(audioCache.awake2);
            }
            setTimeout(() => {
                if (pick && pick.parentNode) pick.remove();
            }, 800);
        }

        setTimeout(chanceToRemove, 10);
    }

    function playSound(b64Data) {
        const snd = new Audio(b64Data);
        snd.play().catch(() => {});
        snd.onended = () => { snd.remove(); };
    }

    function trigger() {
        if (!active) {
            if (parsedPlayed) {
                return;
            }
            flashTimer = 1;
            evokescp079();
            playSound(audioCache.one);
            setTimeout(() => {
                playSound(audioCache.parsing);
                parsedPlayed = true;
                setTimeout(() => { 
                    active = true; 
                    chanceToRemove(); 
                }, 6000);
            }, 1000);
        }
    }

    document.addEventListener('click', trigger);

})();